import React, {useState} from 'react';
import axios from 'axios';
import './App.css';
import Button from './components/button';

function App() {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [resp, setResp] = useState({});
  const [error, setError] = useState('');

  const handleChange = (e) => {
    console.log(e.target.name);
    if (e.target.name === "name") {
      setName(e.target.value);
    } else if (e.target.name === "email") {
      setEmail(e.target.value);
    } else if (e.target.name === "password") {
      setPassword(e.target.value);
    }
  }

  const handleSubmit = async (event) => {
    event.preventDefault();
    console.log(name, email, password);

    try {
      //const response = await axios('http://localhost:8080/welcome');
      //console.log(response.data);
      //setResp(response);

      const userData = {
        userName: name,
        userEmail: email,
        userPassword: password
      }

      axios.post('http://localhost:8080/login', userData)
      .then((response) => {
        console.log(response);
      })
      .catch((error) => {
        console.log('The Error: ', error);
        setError(error);
      });
    } catch (e) {
      console.log(e);
    }
  }

  return (
    <div className="App">
      <header className="App-header">
        <form>
          <div>
            <label for="name">Name:</label>
            <input type="text" id="name" name="name" value={name} onChange={e => handleChange(e)}></input>
          </div>

          <div>
            <label for="emailAddress">Email:</label>
            <input type="email" id="emailAddress" name="email" value={email} onChange={e => handleChange(e)}></input>
          </div>

          <div>
            <label for="password">Password:</label>
            <input type="password" id="password" name="password" value={password} onChange={e => handleChange(e)}></input>
          </div>

          <div>
            { /*<button id="submit-button" onClick={handleSubmit}>Submit</button> */ }
            <Button submit={handleSubmit} userName={name} />
          </div>

          {resp && <p id="welcome">{resp.data}</p> }
          {/* error && <p>{error}</p> */}
        </form>
      </header>
    </div>
  );
}

export default App;
